        unusual vocal jam occurs alongside \"On Broadway\" teasing, followed by a
        rocking and intense jam, which is unfinished, and -\u0026gt; to \"The Mango
        Song.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72677,"track_id":7266,"tag_id":4,"created_at":"2019-04-14T01:02:21.489Z","notes":"Long,
