        the jam grows angry and growly, then explores more ground before ratcheting
        up in tension and bursting back to \"Weekapaug.\" -\u0026gt; to \"The Mango
        Song.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72319,"track_id":18212,"tag_id":4,"created_at":"2019-04-14T01:02:08.854Z","notes":"\u0026gt;
        in from \"Mango Song.\" Has a distinctly funky sound at first. Lots of great
        shredding by Trey. At about 4:50, breaks into a brief, funky, very non-\"Brother\"
        groove, then returns home to conclude.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72323,"track_id":18350,"tag_id":4,"created_at":"2019-04-14T01:02:08.957Z","notes":"\u0026gt;
        in from \"NICU.\" Another strong ''98 version in which Page plays a noticeably
        strong role, but Trey''s no slouch either. \u0026gt; to \"The Mango Song.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70999,"track_id":20689,"tag_id":4,"created_at":"2019-04-14T01:01:22.393Z","notes":"\u0026gt;
        in from \"Halley''s Comet.\" Great version where the band explores and improvises
        with the basic \"Mango\" theme in a greatly extended outro jam that transitions
        to \"Twist.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70701,"track_id":20957,"tag_id":4,"created_at":"2019-04-14T01:01:11.694Z","notes":"\u0026gt;
        in from \"Ghost.\" Similar to 5/22/00 where the band extends the ending by
        several minutes, but sticks to \"The Mango Song\" melody.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71455,"track_id":24484,"tag_id":4,"created_at":"2019-04-14T01:01:38.042Z","notes":"Another
        excellent version with an extended jam that at various times is rhythmic,
        melodic, spacious, and powerful. Segue to \"Mango Song\" continues to draw
        praise from fans.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71260,"track_id":26899,"tag_id":4,"created_at":"2019-04-14T01:01:31.377Z","notes":"A
