        alternate lyrics.\r\n- * these tracks contain patches with a CassX SBD...there
        is substantial hiss durring these portions, but it does make the show more
        complete than previously.\r\n\r\nSet II-\r\n \r\n/Take the A Train\r\nTweezer\r\nHarry
        Hood\r\nCaravan\r\nThe Divided Sky\r\nDavid Bowie\r\nContact\r\n\r\n\r\nShow/Set
        II story via Rob Livingston:\r\n\r\n\"Anyway, as we arrived for soundcheck,
        there were about 10 of us hanging out under overcast skies. \r\nMarley was
        running around and it was a great vibe. When the show started, \r\nit started
        raining lightly which became steadier throughout the set. \r\nTrey seemed
        to be playing the storm as the peaks occurred as the rain became sheets. \r\nThe
        crowd grew throughout the set but to no larger than 50-60 people. \r\nThen
        came the thunder and a few shots of lightning. When it got to be its worst,
        \r\nTrey announced that due to the storm, they would be unable to finish the
        show.\" \r\n\r\n\"While all were bummed (and most tripping), we understand
        and went back to our rooms to plan alternate activities. \r\nAfter about 30
        minutes, word of mouth spread that they had agreed to play a second set in
        the Co-op lounge. \r\nAll their equipment was packed away so they agree to
        use the gear of our campus cover band \"Pi\". \r\nWhen I arrived at the co-op
